import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  container: {
    display: 'flex',
    justifyContent: 'center',
    width: 500,
    margin: '0 auto',
  },
  imgActivity: {
    width: '100%',
  }
})

export default styles
